import styled from "styled-components";

const CardStyled = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 26em;
  height: 16em;
  margin: 2em;
  padding: 0;
  border-radius: 10px;
  background-color: #dcdde1;
`;

export default CardStyled;
